import React, { useState } from 'react';
import NewQueueStyle from './add-new-queue.module.scss';
import Modal from '../../../../../../models/ui/modal/modal';

interface OwnProps {
    close: () => void;
    addNewQueue?: () => void
}

const NewQueue: React.FC<OwnProps> = (props) => {
    const [Form, setForm] = useState({
        title: "",
        phone: ""
    });

    const handleChange = (e: any, name: string) => {
        setForm({
            ...Form, [name]: e.target.value
        });
    }

    const onSubmit = (e: any) => {

    }

    const schild = (
        <form onSubmit={onSubmit}>
            {/* Title */}
            <div className={NewQueueStyle.FormGroup}>
                <input
                    type="text"
                    onChange={(e) => handleChange(e, 'title')}
                    autoComplete="off"
                    value={Form.title}
                    required
                    placeholder="כותרת"
                />
            </div>
            {/* Client Phone */}
            <div className={NewQueueStyle.FormGroup}>
                <input
                    type="tel"
                    onChange={(e) => handleChange(e, 'phone')}
                    autoComplete="off"
                    value={Form.phone}
                    required
                    placeholder="טלפון הלקוח"
                />
            </div>
        </form>
    )
    return (
        <div className={NewQueueStyle.NewQueue}>
            <Modal title="קביעת תור" close={props.close} >
                {schild}
            </Modal>
        </div>
    )
}


export default NewQueue;
